import React from "react";
import DeleteButton from "./"

export default class List extends React.Component {
  render() {
    return (
      <div>
        <ul>
          {
            this.props.list.map(item => {
              return (
                <li key={item}>
                  {item}
                  <DeleteButton deletebtn={this.props.deletebtn} />
                </li>
              )
            })
          }
        </ul>
      </div>

    );
  }
}
